    <>
      <img src="/dogs.jpg" alt="Dogs" className="border-b border-current" />
      <div className="h-14 flex items-center justify-center">
        <h1 className="text-lg">Macarons</h1>
      </div>
    </>
  );
};

export default Recipe;
